class Solution(object):
    def maximumProduct(self, nums, k):
        from functools import reduce
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        def findproduct(lst):
            mod = (10**9) +7
            product = reduce(lambda x, y: x * y, lst) # reduce the complexity , iterate through all the elements of the list
            return product%mod
        for i in range(k):  # it will continue until the given number reach 
            number_index = nums.index(min(nums)) # finding the min number 
            nums[number_index]+=1 

        prod = findproduct(nums)

        return prod
    
